-- ----------------------------
-- Table structure for scy_ordertimeline
-- ----------------------------
DROP TABLE IF EXISTS `scy_ordertimeline`;
CREATE TABLE `scy_ordertimeline` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `insurerid` int(11) DEFAULT NULL COMMENT '保险公司id',
  `rs` varchar(255) NOT NULL COMMENT '险种表对应值',
  `username` varchar(20) NOT NULL COMMENT '用户名',
  `phone` varchar(20) NOT NULL COMMENT '保单手机',
  `realname` varchar(20) DEFAULT NULL COMMENT '保单姓名',
  `id_license` varchar(18) DEFAULT NULL COMMENT '身份证',
  `ids_pics` varchar(255) DEFAULT NULL COMMENT '身份证头像',
  `ordernumber` varchar(255) DEFAULT NULL,
  `fktype` tinyint(1) NOT NULL COMMENT '0分期付款1全款',
  `install_day` tinyint(2) NOT NULL COMMENT '每月还款日(1-28)',
  `install_fee` float(13,2) DEFAULT NULL,
  `addtime` datetime NOT NULL COMMENT '创建时间',
  `admin_note` text NOT NULL COMMENT '管理员反馈',
  `fpaydeadline` datetime NOT NULL COMMENT '最后支付时间',
  `paystat` int(11) NOT NULL DEFAULT '0',
  `paytime` datetime NOT NULL,
  `fqstat` tinyint(1) DEFAULT NULL COMMENT '0初始状态，1已认证，2初审，3复审，4签约，-1失效',
  `firsttime` datetime DEFAULT NULL COMMENT '分期初审时间',
  `firstadminid` int(11) DEFAULT NULL COMMENT '分期初审人ID',
  `secondtime` datetime DEFAULT NULL COMMENT '分期复审时间',
  `secondadminid` int(11) DEFAULT NULL COMMENT '分期复审人ID',
  `signtime` datetime DEFAULT NULL COMMENT '签约时间',
  `submittime` datetime DEFAULT NULL COMMENT '提交时间',
  `stat` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0初审中，1复审中，2拨款中，3出单中，4生效中，5过期，6违约',
  `inspecttime` datetime DEFAULT NULL COMMENT '支付保费初审时间',
  `inspectadminid` int(11) DEFAULT NULL COMMENT '支付保费初审人id',
  `comfirmtime` datetime DEFAULT NULL COMMENT '支付保费复审时间',
  `comfirmadminid` int(11) DEFAULT NULL COMMENT '支付保费复审人ID',
  `approtime` datetime DEFAULT NULL COMMENT '支付保费拨款时间',
  `approadminid` int(11) DEFAULT NULL COMMENT '支付保费拨款人ID',
  `checktime` datetime NOT NULL COMMENT '出单时间',
  `awakedate` date NOT NULL,
  `awaketime` datetime NOT NULL COMMENT '生效时间',
  `yuqistat` enum('0','1') NOT NULL DEFAULT '0',
  `yuqicount` int(11) NOT NULL DEFAULT '0',
  `broke_flag` int(11) NOT NULL DEFAULT '0' COMMENT '提前还款标记',
  `fakuan` float(13,2) NOT NULL DEFAULT '0.00' COMMENT '违约金',
  `content` text NOT NULL,
  `active` int(11) NOT NULL DEFAULT '1' COMMENT '0已完结，1正在执行',
  `isfhb` tinyint(1) NOT NULL DEFAULT '0',
  `orderpics` text NOT NULL COMMENT '保单图片集',
  `express_company` varchar(255) NOT NULL COMMENT '快递公司',
  `express_address` varchar(255) DEFAULT NULL COMMENT '保单收货地址',
  `express_id` varchar(255) NOT NULL COMMENT '快递单号',
  `express_phone` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=423 DEFAULT CHARSET=utf8 COMMENT='订单表\r\n询价成功创建(addtime)\r\n分期->提交资料(fqstat=1)->初审(fqstat=2,firsttime,firstadminid)->复审(fqstat=3,secondtime,secondadminid)->签约(fqstat=4,signtime)->提交保单(submittime)\r\n全款->支付(paystat=1,paytime)->提交保单(submittime)\r\n\r\n保单提交后->保险公司申请支付保费->平台初审(stat=1,inspecttime,inspectadminid)->复审(stat=2,offertime,offeradminid)->拨款(stat=3,approtime,approadminid)->保险公司审核出单(stat=4,checktime)->生效(awaketime)';

-- ----------------------------
-- Records of scy_ordertimeline
-- ----------------------------

