  `id_img` varchar(255) NOT NULL,
  `id_img_b` varchar(255) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `rs` (`rs`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='报价表';

